import React, { Component } from 'react';
import { Butt } from './Butt'

export default class Abou extends Component {
	render() {
		return (

			<div className="card card-body my-3">
				<form>						
					<Butt type="submit" className="btn btn-block"> 
						Learn More 
					</Butt>
				</form>				
			</div>



		);
	}
}
